import React from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';

const Row = (props: IRowProps) => {
    
    return (
        <>
            <div className="row">
                <Column style={{backgroundColor: '#5babea'}}/>
                <Column style={{backgroundColor: '#5babea'}}/>
                <Column style={{backgroundColor: '#5babea'}}/>                
            </div>
        </>
    )
}

export default Row;
